import React from 'react';
import './mainInterface.css'; // 引入样式文件

const MainInterface = () => {
    return (
        <div className="main-interface">
            <LeftPanel />
            <RightPanel />
        </div>
    );
};

const LeftPanel = () => {
    return (
        <div className="left-panel">
            <button className="new-interview-button">+ New Interview</button>
            {/* 这里可以用一个map函数遍历历史面试 */}
            <button className="user-name-button">Your Name</button>
        </div>
    );
};

const RightPanel = () => {
    return (
        <div className="right-panel">
            <div className="info-bar">Information Bar</div>
            <textarea className="text-area" placeholder="Type your message..."></textarea>
        </div>
    );
};

export default MainInterface;
